import React from "react";
import pdata from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
  Bar,
} from "recharts";
const BarChart = () => {
  return (
    <>
      <ResponsiveContainer width="100%" aspect={2}>
        <BarChart width={730} height={250} data={pdata}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="fees" fill="#8884d8" />
          <Bar dataKey="student" fill="#82ca9d" />
        </BarChart>
      </ResponsiveContainer>
    </>
  );
};

export default BarChart;
